/**
设置正在播放的回调
callback(res) res:{current:毫秒数,total:总毫秒数，percent：播放进度}
**/
setOnPlaying(callback)

/**
设置播放结束的回调
**/
setOnCompletion(callback)


/**
设置错误的回调
**/
