demo























    module.exports = {
        data: {
            play:false,
            status:"play"
        },
        methods: {
            click : function(e) {
                var lottie = this.$refs.lottie;
                var lottie1 = this.$refs.lottie1;
                var lottie2 = this.$refs.lottie2;
                var lottie3 = this.$refs.lottie3;
                var lottie4 = this.$refs.lottie4;
                var lottie5 = this.$refs.lottie5;
                var lottie6 = this.$refs.lottie6;
                var lottie7 = this.$refs.lottie7;
                if (this.play) {
                    this.play = false;
                    lottie.reset();
                    lottie1.reset();
                    lottie2.reset();
                    lottie3.reset();
                    lottie4.reset();
                    lottie5.reset();
                    lottie6.reset();
                    lottie7.reset();
                    this.status = "play";
                }else {
                    this.play = true;
                    lottie.play();
                    lottie1.play();
                    lottie2.play();
                    lottie3.play();
                    lottie4.play();
                    lottie5.play();
                    lottie6.play();
                    lottie7.play();
                    this.status='stop'
                }
            }
        }
    }

